import React, { useState } from "react";
import "./All.css"
import icon from "../Resimler/Süperlig_logo.png"
import { Link } from "react-router-dom";
import axios from "axios";

const Profil = () => {

    const data = {email:"",password:""};
    const [profil,setProfil]=useState(data)

    const handleData = (e) =>{
        setProfil({...profil,[e.target.name]:e.target.value})
    }

    const handleSubmit =(e) =>{
        e.preventDefault();
        axios.post("https://cryptic-gorge-72989.herokuapp.com/login",profil)
            .then(response=>{
                console.log(response)
            })
    }

    return (
        <div>
            <div className="Profil-cercevesi">
                <div className="Profil-cerceve-ici">
                    <div className="orta">
                        <img src={icon} width="70" />
                    </div><br />
                    <p style={{ fontSize: 13 }}>İlk Defa Süperlig Analiz  ? <Link to={"/Profil/Hesap_olusturma"}>Hesapı Oluşturucam</Link> </p>
                    <p>İlk Kaydını <Link to={"/Kayıtol"}>Oluştur</Link></p>
                    <div class="form-floating mb-3">
                        <input type="email" class="form-control" id="floatingInput" placeholder="Kullanıcı Adı"/>
                            <label for="floatingInput">
                            <i class="fa-solid fa-user fa-bounce"></i> E-Mail
                            </label>
                    </div>
                    <div class="form-floating">
                        <input type="password" class="form-control" id="floatingPassword" placeholder="Password"/>
                            <label for="floatingPassword">
                            <i class="fa-solid fa-lock fa-bounce"></i> Şifre
                            </label>
                    </div><br/>
                    <p style={{ fontSize: 14 }}><input type="checkbox" placeholder="Şifre" /> Beni Her Zaman Hatırla</p>
                    <Link to={"/"}><p><button className="button-genisligi btn btn-light"><i class="fa-solid fa-arrow-right-to-bracket"></i></button></p></Link>
                    <p style={{ textAlign: "center" }}>veya şununla giriş yapın:</p>
                    <div className="orta">
                        <button className="f1 a1 btn btn-light"><i class="fa-brands fa-facebook"></i></button>
                        <button className="ı2 a2 btn btn-light"><i class="fa-brands fa-instagram"></i></button>
                        <button className="t3 a3 btn btn-light"><i class="fa-brands fa-twitter"></i></button>
                    </div><br />
                    <p style={{ textAlign: "center", fontSize: 13 }}><Link to={"/Profil/Hesap_olusturma/kullanıcıadı"}>Kullanıcı adınızı</Link> ya da <Link to={"/Profil/Hesap_olusturma/Kullanıcıadı/Sifre"}>şifrenizi</Link> erişimi mi gerekiyor?</p>
                </div>
            </div><br />
            <p style={{ textAlign: "center", fontSize: 12 }}>Telif Hakkı © 1959 - 2023 Süper Lig Operating Company, LLC. Tüm Hakları Saklıdır. Gizlilik Politikası</p>
        </div>
    )
}
export default Profil;
